from datetime import date, datetime, timedelta

import requests
from bs4 import BeautifulSoup
from boltons import iterutils
import csv
import yaml


def url_ok(url):
    r = requests.head(url)
    return r.status_code


def get_prices_rbzts():
    url = "http://183.82.5.184/rbzts/DailyPrices.aspx"
    status_code = url_ok(url)
    if status_code == 503 or status_code == 502 or status_code == 504 or status_code == 500:
        return "Rbzts Service/Website is currently DOWN or not available"
    else:
        try:
            report_dates = []
            report_months = []
            report_years = []
            with open('config/values.yaml', 'r') as file:
                prime_service = yaml.safe_load(file)
                from_date = datetime.strptime(prime_service['dates']['fromDate'], "%d/%m/%Y")
                to_date = datetime.strptime(prime_service['dates']['toDate'], "%d/%m/%Y")
                days = abs((from_date - to_date).days) + 1

                for x in range(days):
                    d = from_date + timedelta(days=x)
                    report_dates.append(str(d.day))
                    report_months.append(str(d.month))
                    report_years.append(str(d.year))

            for (a, b, c) in zip(report_dates, report_months, report_years):
                body = "ctl00%24ContentPlaceHolder1%24ScriptManager1=ctl00%24ContentPlaceHolder1%24UpdatePanel1%7Cctl00%24ContentPlaceHolder1%24btnShow&ctl00%24ContentPlaceHolder1%24txtdate=" + a + "%2F" + b + "%2F" + c + "&__EVENTTARGET=&__EVENTARGUMENT=&__VIEWSTATE=%%&__VIEWSTATEGENERATOR=5E4F0D91&__EVENTVALIDATION=%2FwEWBwLfp%2FDpBwK0w8TECwKj3qG5BQKa9tKLBgKV9O6dBQKIhriSDwLssvLQA5OSc6tcCPZUdpKBGdSuAsvkaeLo&__ASYNCPOST=true&ctl00%24ContentPlaceHolder1%24btnShow=Show"
                headers = {
                    'Accept': '* / *',
                    'Accept-Language': 'en-US,en;q=0.9',
                    'Cache-Control': 'no - cache',
                    'Connection': 'keep-alive',
                    'Content-Type': 'application/x-www-form-urlencoded; charset=UTF-8',
                    'Cookie': 'ASP.NET_SessionId=ffqwkn45e1an41aswki5ndef',
                    'Origin': 'http://183.82.5.184',
                    'Referer': 'http://183.82.5.184/rbzts/DailyPrices.aspx',
                    'User-Agent': 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/119.0.0.0 Safari/537.36 Edg/119.0.0.0',
                    'X-MicrosoftAjax': 'Delta=true'
                }
                req = requests.request(method='post', url=url, headers=headers, data=body)

                soup = BeautifulSoup(req.content, "html.parser")
                table = soup.find(
                    lambda tag: tag.name == 'table' and tag.has_attr('id') and tag[
                        'id'] == "ctl00_ContentPlaceHolder1_GridView1")
                rows = table.findAll(lambda tag: tag.name == 'td')
                prices = []
                fields = ['District', 'Rythu Bazar', 'Vegetable', 'Arrivals', 'LocalMarket Rate', 'RythuBazar Rate']

                for td in rows:
                    for child in td.children:
                        prices.append(child.text.strip())

                it = iterutils.chunked(prices, 6)
                with(open('rbzts_prices_report_' + c + '' + b + '' + a + '.csv', 'w', newline='')) as csvfile:
                    writer = csv.writer(csvfile)
                    writer.writerow(fields)
                    writer.writerows(it)
            return "Scrape Success. Rbzts Files generated"

        except Exception as e:
            return str(e)


